import React from 'react';
import cricketimage from '../../assets/cricket.jpg';

const Cricket = () => {
    return (
        <div className='min-h-screen'>
           <div>
            <img src={cricketimage} alt="" />
            </div> 
        </div>
    );
};

export default Cricket;
